import React from "react";

export default function Square({ width=42, height=42, rotation=0, colors=["grey", "black"] }) {
  return (
    <div
      style={{
        width: width,
        height: `height`,
        transform: `rotate(${rotation}deg)`,
        position: "relative",
      }}
    >
      <div
        style={{
          width: width - 6,
          height: height - 6,
          border: `1px solid ${colors[0]}`
        }}
      ></div>
      <div
        style={{
          width: width - 6,
          height: height - 6,
          background: colors[1],
          position: "absolute",
          bottom: 0,
          right: 0
        }}
      ></div>
    </div>
  );
}
